import React, { useState } from 'react';
import './SetupScreen.css';

function SetupScreen({ onComplete }) {
  const [founderName, setFounderName] = useState('');
  const [industry, setIndustry] = useState('');
  const [startupName, setStartupName] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (founderName && industry && startupName) {
      onComplete({
        founderName,
        industry,
        startupName
      });
    }
  };

  const backgroundStyle = {
    backgroundImage: `url(${process.env.PUBLIC_URL}/generic-background.png)`
  };

  return (
    <div className="setup-screen" style={backgroundStyle}>
      <div className="setup-container">
        <div className="setup-left">
          <div className="setup-header">
            <h1 className="setup-title handjet-font">Startup Tycoon</h1>
            <p className="setup-subtitle cabin-sketch-font">Can you build the next unicorn? ðŸ¦„</p>
          </div>

          <div className="character-section">
            <img 
              src={`${process.env.PUBLIC_URL}/set-up.png`} 
              alt="Startup founder character" 
              className="character-image"
            />
          </div>
        </div>

        <div className="setup-right">
          <div className="logo-corner">
            <img 
              src={`${process.env.PUBLIC_URL}/logo.png`} 
              alt="Logo" 
              className="corner-logo"
            />
          </div>

          <div className="form-container">
            <div className="form-header">
              <h2 className="form-title handjet-font">Startup Tycoon</h2>
              <p className="form-subtitle cabin-sketch-font">Can you build the next unicorn? ðŸ¦„</p>
            </div>

            <form onSubmit={handleSubmit} className="setup-form">
              <div className="form-group">
                <label className="form-label handjet-font">What's your name, founder?</label>
                <input
                  type="text"
                  value={founderName}
                  onChange={(e) => setFounderName(e.target.value)}
                  placeholder="Steve Jobs"
                  className="form-input handjet-font"
                  required
                />
              </div>

              <div className="form-group">
                <label className="form-label handjet-font">What industry will you disrupt?</label>
                <select
                  value={industry}
                  onChange={(e) => setIndustry(e.target.value)}
                  className="form-select handjet-font"
                  required
                >
                  <option value="" disabled>Technology & Hardware</option>
                  <option value="Education">Education</option>
                  <option value="AI">AI</option>
                  <option value="Social Network">Social Network</option>
                </select>
              </div>

              <div className="form-group">
                <label className="form-label handjet-font">What's your startup called?</label>
                <input
                  type="text"
                  value={startupName}
                  onChange={(e) => setStartupName(e.target.value)}
                  placeholder="Apple"
                  className="form-input handjet-font"
                  required
                />
              </div>

              <button type="submit" className="register-button handjet-font">
                Register my company
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SetupScreen;
